import axios from "axios";
export const fetchData = ({ amount, paymentMethodId }) => {
  const data = {
    amount,
    paymentMethodId,
  };
  return axios.post("/payment", {
    amount: amount,
    paymentMethodId: paymentMethodId,
  });
};
